import React, { Component } from "react";
import ReactDOM from "react";

function contont(){
        return(
                <label id = "in1"> JavaScript</label>,
                <input type="checkbox" htmlFor="in1"></input>,
                <label id="in2">python</label>,
                <input type="checkbox" id="in2"></input>,
                <label id="in3">C++</label>,
                <input type="checkbox" id="in3"></input>
            )
}

export default contont;
